import React, { Component } from 'react';
export default class Header extends Component {
  componentDidMount () {
    const script = document.createElement("script");

    script.src = "https://cdn.jsdelivr.net/github-cards/latest/widget.js";
    script.async = true;

    document.body.appendChild(script);
}

  render() {
    return (
      <React.Fragment>
      {
        <section id="portfolio">
        {/* <div class="row">
  <div class="column">
  <div className="item-wrap">
    <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="300" data-height="" data-theme="default"></div>
    </div>
  </div>
  <div class="column">
    <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="300" data-height="" data-theme="default"></div>
  </div>
  <div class="column">
    <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="300" data-height="" data-theme="default"></div>
  </div>
</div> */}

              </section>
      }
      </React.Fragment>
    );
  }
}
 <div className="row">
                  <div className="twelve columns collapsed">
                    <h1>Check Out Some of My Works.</h1>
                    {/* portfolio-wrapper */}
                    <div id="portfolio-wrapper" className="bgrid-quarters s-bgrid-thirds cf">
                      <div className="columns portfolio-item">
                        <div className="item-wrap">

                          <a href="#modal-01" title>
                            {/* <img alt src="images/portfolio/coffee" /> */}
                            <div className="overlay">
                            <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="300" data-height="" data-theme="default"></div>

                              {/* <div className="portfolio-item-meta">
                                <h5>Coffee</h5>
                                <p>Illustrration</p>
                              </div> */}
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                      <div className="columns portfolio-item">
                        <div className="item-wrap">
                          <a href="#modal-02" title>
                            <div className="overlay">
                            <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="400" data-height="" data-theme="default"></div>
                              <div className="portfolio-item-meta">
                                <h5>Console</h5>
                                <p>Web Development</p>
                              </div>
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                      <div className="columns portfolio-item">
                        <div className="item-wrap">
                          <a href="#modal-03" title>
                            <div className="overlay">
                            <div class="github-card" data-github="atishayjain708/TS_MF_cluster_analysis" data-width="400" data-height="" data-theme="default"></div>
                              <div className="portfolio-item-meta">
                                <h5>Judah</h5>
                                <p>Webdesign</p>
                              </div>
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                      <div className="columns portfolio-item">
                        <div className="item-wrap">
                          <a href="#modal-04" title>
                            <img alt src="images/portfolio/into-the-light" />
                            <div className="overlay">
                              <div className="portfolio-item-meta">
                                <h5>Into The Light</h5>
                                <p>Photography</p>
                              </div>
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                      <div className="columns portfolio-item">
                        <div className="item-wrap">
                          <a href="#modal-05" title>
                            <img alt src="images/portfolio/farmerboy" />
                            <div className="overlay">
                              <div className="portfolio-item-meta">
                                <h5>Farmer Boy</h5>
                                <p>Branding</p>
                              </div>
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                      <div className="columns portfolio-item">
                        <div className="item-wrap">
                          <a href="#modal-06" title>
                            <img alt src="images/portfolio/girl" />
                            <div className="overlay">
                              <div className="portfolio-item-meta">
                                <h5>Girl</h5>
                                <p>Photography</p>
                              </div>
                            </div>
                            <div className="link-icon"><i className="icon-plus" /></div>
                          </a>
                        </div>
                      </div> {/* item end */}
                    </div> {/* portfolio-wrapper end */}
                  </div> {/* twelve columns end */}
              </div>


              //     {/* Modal Popup
